import React from 'react';

const Edukacija = () => {
    return (
         <div className="edukacija">
             <div className="opis">
                 <h2>Едукација</h2>
                 <p>Компаниите имаат можност да ги надоградат своте тимови,а со тоа да го подобрат перформансот на својата компанија.</p>
                 <p>Дигитлната трансформација се случува, а вашите компании треба да бидат подготвени да се адаптираат соодветно
                     Обуки, семинари, курсеви или team building?
                 </p>
                 <p>Во Brainster Space имаме специјално обучен тим кој е подготвен да ја насочи
                     и адаптира својатаекспертиза со денешните потреби на компаниите.
                 </p>
             <div></div>
                 <button>АКАДЕМИИ</button>
                 <button>КОМПАНИИ</button>
             </div>
             <div className="slikaEdu"></div>
         </div>
         
         );
}
 
export default Edukacija;
